/* eslint-disable */
import PropTypes from 'prop-types';
import React from 'react';

// material-ui
import { Avatar, Button, CardActions, CardContent, Divider, Grid, Typography } from '@material-ui/core';
import MuiTypography from '@material-ui/core/Typography';

// project imports
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';
import UserDetailsAlert from './UserDetailsAlert';

// ===========================|| DATA WIDGET - TEAM MEMBERS CARD ||=========================== //

const TeamMembers = ({ title, location, userData,}) => (
    <MainCard title={<>{title}<h5><MuiTypography variant="subtitle2" gutterBottom>{location}</MuiTypography></h5></>} content={false}>
        <CardContent>
            <Grid container spacing={gridSpacing} alignItems="center">


                {userData.map((user) => {
                    return (
                        <UserDetailsAlert user={user}/>
                    )
                })}
            </Grid>
        </CardContent>
        <Divider />
    </MainCard>
);

TeamMembers.propTypes = {
    title: PropTypes.string
};

export default TeamMembers;
